import React, {Component} from 'react';
//import {Router, Link} from "react-router-dom";
import {Row} from "react-bootstrap";
import {Col} from "react-bootstrap";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faHeart, faPhone, faAddressBook, faUser  } from '@fortawesome/free-solid-svg-icons';

class HeaderLinks extends Component {
    render() {
        return (
            <Row className={'m-2'}>
                <Col xs={6}>
                    <a href="#"><FontAwesomeIcon icon={faPhone} />+90 555 111 11 00</a>
                </Col>
                <Col className={'text-right'} xs={6}>
                    <a href="#" className={'pl-3'}><FontAwesomeIcon icon={faAddressBook} /> <span className={'d-xs-none'}>Login</span></a>
                    <a href="#" className={'pl-3'}><FontAwesomeIcon icon={faUser} /> <span className={'d-sm-none'}>Register</span></a>
                    <a href="#" className={'pl-3'}><FontAwesomeIcon icon={faHeart} /> <span className={'d-sm-none'}>Favorites</span></a>
                </Col>
            </Row>
        );
    }
}

export default HeaderLinks;
